{"translationLines":[{"lineNumber":40231,"originalJapaneseLine":"　結局、戦うしかないみたいだが……」","translatedEnglishLine":"\"In the end, it seems we have no choice but to fight...\""},{"lineNumber":40232,"originalJapaneseLine":"「ふわぁ……ま、男の魔人だろ。","translatedEnglishLine":"\"Fuwaa... Well, he's a male demon, right.\""},{"lineNumber":40233,"originalJapaneseLine":"　サクーッと殺してくれるわ」","translatedEnglishLine":"\"He'll just cut us down quick.\""},{"lineNumber":40234,"originalJapaneseLine":"「強さは本物だぞ。油断するな」","translatedEnglishLine":"\"His strength is genuine. Don't let your guard down.\""},{"lineNumber":40235,"originalJapaneseLine":"「大丈夫だ大丈夫……っと、もう晴れたか」","translatedEnglishLine":"\"It's okay, it's okay... Oh, has it cleared up already?\""},{"lineNumber":40236,"originalJapaneseLine":"「急に降ってくるけど、止むのも急なんですよね」","translatedEnglishLine":"\"It pours down suddenly, but it also stops suddenly.\""},{"lineNumber":40237,"originalJapaneseLine":"「よーしいくぞ。では出発だー」","translatedEnglishLine":"\"Alright, let's go. Then, let's depart!\""},{"lineNumber":40238,"originalJapaneseLine":"ランス達は平原へと戻り、再び進軍を始めた。","translatedEnglishLine":"Lance and the others returned to the plains and began marching again."},{"lineNumber":40239,"originalJapaneseLine":"『ホ、本当ニ無視サレタ……シクシク』","translatedEnglishLine":"'I-I was really ignored... sob sob'"},{"lineNumber":40240,"originalJapaneseLine":"ガタゴトと音を立て、うし車が進む。","translatedEnglishLine":"With a clatter, the ox cart moved forward."},{"lineNumber":40241,"originalJapaneseLine":"「ふあ……うむ。楽ちん楽ちん」","translatedEnglishLine":"\"Fua... Hmm. So comfy, so comfy.\""},{"lineNumber":40242,"originalJapaneseLine":"「……………………」","translatedEnglishLine":"\"...........................\""},{"lineNumber":40243,"originalJapaneseLine":"そのうし車の荷台に潜り込み、","translatedEnglishLine":"Hiding in the cargo area of that ox cart,"},{"lineNumber":40244,"originalJapaneseLine":"ランスは流れる景色を楽しんでいた。","translatedEnglishLine":"Lance enjoyed the passing scenery."},{"lineNumber":40245,"originalJapaneseLine":"「なあ……本当に守ってくれるのか？","translatedEnglishLine":"\"Hey... are you really going to protect me?"},{"lineNumber":40246,"originalJapaneseLine":"　あの人、全然やる気なさそうな……」","translatedEnglishLine":"That guy seems totally unmotivated...\""},{"lineNumber":40247,"originalJapaneseLine":"「あ……いえ、大丈夫です。大丈夫……」","translatedEnglishLine":"\"Ah... no, it's fine. It'll be fine...\""},{"lineNumber":40248,"originalJapaneseLine":"「そ、そうか……頼むぜ」","translatedEnglishLine":"\"I-is that so... I'm counting on you.\""},{"lineNumber":40249,"originalJapaneseLine":"不安げに首を傾げつつ、","translatedEnglishLine":"Tilting his head anxiously,"},{"lineNumber":40250,"originalJapaneseLine":"荷運びはうしを操って道中を進む。","translatedEnglishLine":"The cargo transport guided the ox along the road."},{"lineNumber":40251,"originalJapaneseLine":"「それにしても……おっきいね……いっぱいあるね」","translatedEnglishLine":"\"Even so... they're big... and there are so many.\""},{"lineNumber":40252,"originalJapaneseLine":"『だめよカロリアちゃん。つまみ食いは。","translatedEnglishLine":"'No, Karoria-chan. No snacking.'"},

{"lineNumber":40253,"originalJapaneseLine":"　ほら、よだれ拭いて拭いて』","translatedEnglishLine":"'Come on, wipe your drool, wipe it off.'"},

{"lineNumber":40254,"originalJapaneseLine":"「う……大丈夫だよ、大丈夫」","translatedEnglishLine":"\"Ugh... It's okay, it's okay.\""},{"lineNumber":40255,"originalJapaneseLine":"「がははは、ちょっとくらいいいだろ。","translatedEnglishLine":"\"Gahaha, a little bit won't hurt.\""},{"lineNumber":40256,"originalJapaneseLine":"　むぐもぐ……うむ、すっぱい」","translatedEnglishLine":"\"Munch munch... Hmm, it's sour.\""},{"lineNumber":40257,"originalJapaneseLine":"「このくらいないと全然足りないんだ。","translatedEnglishLine":"\"Without at least this much, it wouldn't be nearly enough.\""},{"lineNumber":40258,"originalJapaneseLine":"　なんせ、前線じゃまったく食料がない状態が","translatedEnglishLine":"\"Because at the front line, they're apparently completely out of food.\""},{"lineNumber":40259,"originalJapaneseLine":"　続いてるらしいからな」","translatedEnglishLine":"\"It seems the situation continues like that.\""},{"lineNumber":40260,"originalJapaneseLine":"「……まあ、その食料も","translatedEnglishLine":"\"...Well, that food too"},{"lineNumber":40261,"originalJapaneseLine":"　例の魔人に取られてるらしいが……」","translatedEnglishLine":"is said to be taken by that demon...\""},{"lineNumber":40262,"originalJapaneseLine":"「……ガルティアね」","translatedEnglishLine":"\"...Gartia, huh.\""},{"lineNumber":40263,"originalJapaneseLine":"「これ、全部食べちゃうの？」","translatedEnglishLine":"\"Is he really going to eat all of this?\""},{"lineNumber":40264,"originalJapaneseLine":"「ああ……そうらしいよ。","translatedEnglishLine":"\"Yeah... that's what I've heard.\""},{"lineNumber":40265,"originalJapaneseLine":"　どれだけ大量に食料を渡しても、","translatedEnglishLine":"\"No matter how much food he is given,"},{"lineNumber":40266,"originalJapaneseLine":"　ほとんど一人で食っちまうらしい」","translatedEnglishLine":"he apparently eats almost everything by himself.\""},{"lineNumber":40267,"originalJapaneseLine":"「ふわあ……」","translatedEnglishLine":"\"Fuwaa...\""},{"lineNumber":40268,"originalJapaneseLine":"「コパ帝国もよくやるぜ。","translatedEnglishLine":"\"The Copa Empire also does their best.\""},{"lineNumber":40269,"originalJapaneseLine":"　無駄かもしれないのに、","translatedEnglishLine":"\"Even though it might be meaningless,"},{"lineNumber":40270,"originalJapaneseLine":"　湯水のように物資をぶち込むんだから」","translatedEnglishLine":"they pour supplies like water.\""},{"lineNumber":40271,"originalJapaneseLine":"「コパンドンさんが……」","translatedEnglishLine":"\"Mr. Copandon...\""},{"lineNumber":40272,"originalJapaneseLine":"「JAPANや他の国からも援助は出してますが、","translatedEnglishLine":"\"Aid is also coming from JAPAN and other countries,"},{"lineNumber":40273,"originalJapaneseLine":"　やはり状況は変わらないみたいです……」","translatedEnglishLine":"but it seems the situation hasn't changed...\""},{"lineNumber":40274,"originalJapaneseLine":"「ふーん……ふあ。腹一杯になったら眠くなったな。","translatedEnglishLine":"\"Hmm... Fua. I'm sleepy after eating so much.\""},{"lineNumber":40275,"originalJapaneseLine":"　寝るぞ……うむ、んごごご……」","translatedEnglishLine":"\"I'm going to sleep... Mm, ngogogo...\""},{"lineNumber":40276,"originalJapaneseLine":"「……………………」","translatedEnglishLine":"\"...........................\""},{"lineNumber":40277,"originalJapaneseLine":"「大丈夫です。あの、大丈夫ですから……」","translatedEnglishLine":"\"It's okay. Um, really, it's okay...\""},{"lineNumber":40278,"originalJapaneseLine":"ランスと満載された食料を載せて、","translatedEnglishLine":"With Lance and the fully loaded food supplies onboard,"},{"lineNumber":40279,"originalJapaneseLine":"三十台からのうし車の一団は、","translatedEnglishLine":"a group of over thirty ox carts"},{"lineNumber":40280,"originalJapaneseLine":"のどかなゼスの道を進んでいった。","translatedEnglishLine":"proceeded along the peaceful roads of Zess."},{"lineNumber":40281,"originalJapaneseLine":"うし車の道行きは、細い山道にさしかかった。","translatedEnglishLine":"The ox carts reached a narrow mountain path."},{"lineNumber":40282,"originalJapaneseLine":"「う……ここだここだ。","translatedEnglishLine":"\"Uh... here it is, here it is.\""},{"lineNumber":40283,"originalJapaneseLine":"　ちょっと気をつけてくれよ」","translatedEnglishLine":"\"Be a little careful, please.\""},{"lineNumber":40284,"originalJapaneseLine":"「あ、何か出るんでしたっけ」","translatedEnglishLine":"\"Ah, is something going to appear?\""},{"lineNumber":40285,"originalJapaneseLine":"「山賊だよ山賊。","translatedEnglishLine":"\"Bandits. Bandits.\""},{"lineNumber":40286,"originalJapaneseLine":"　もう何回か、隊商がやられてるって話だ」","translatedEnglishLine":"\"I've heard that several caravans have been attacked already.\""},{"lineNumber":40287,"originalJapaneseLine":"「山賊か……面白い連中であればよいがなあ……」","translatedEnglishLine":"\"Bandits, huh... I hope they're interesting ones...\""},{"lineNumber":40288,"originalJapaneseLine":"「世界がこんな状況だっていうのに、","translatedEnglishLine":"\"Even though the world is in such a state,"},{"lineNumber":40289,"originalJapaneseLine":"　人の上前をはねようなんて……」","translatedEnglishLine":"to go rob others like that...\""},{"lineNumber":40290,"originalJapaneseLine":"「んごごごごご……すぴぴぴぴ……」","translatedEnglishLine":"\"Ngogogogogo... su pipipi...\""}]}

